import iconSupplements from '../images/iconSupplements.png';
import iconInjury from '../images/iconInjury.png';
import iconIllness from '../images/iconIllness.png';
import iconSkin from '../images/iconSkin.png';
import iconDisinfectant from '../images/iconDisinfectant.png';
import iconMedicalTools from '../images/iconMedicalTools.png';

import boldSupplements from '../images/boldSupplements.png';
import boldInjury from '../images/boldInjury.png';
import boldIllness from '../images/boldIllness.png';
import boldSkin from '../images/boldSkin.png';
import boldDisinfectant from '../images/boldDisinfectant.png';
import boldMedicalTools from '../images/boldMedicalTools.png';

function HomeCategories() {
    return(
        <>
            <div className="container section categories">
                <div className="row">
                    <div className="col">
                        <p><h3>Browse products by categories</h3></p>
                        <hr/>
                        <p className="description">Browse our diverse catalog featuring an extensive array of over 80 high-quality products across various categories to find the pharmaceutical solutions that best suit your needs.</p>
                    </div>
                </div>

                <div className="row cat-item">

                    <div className="col supp-hover">
                        <button type="button" class="btn icon-btn "><img className="cat-icon" src={iconSupplements} alt="Supplements category"/></button>
                        <span class="caption">Supplements</span>
                    </div>

                    <div className="col inj-hover">
                        <button type="button" class="btn icon-btn "><img className="cat-icon" src={iconInjury} alt="Injury category"/></button>
                        <span class="caption">Injury</span>
                    </div>

                    <div className="col ill-hover">
                        <button type="button" class="btn icon-btn "><img className="cat-icon" src={iconIllness} alt="Illness category"/></button>
                        <span class="caption">Illness</span>
                    </div>

                    <div className="col skin-icon">
                        <button type="button" class="btn icon-btn ">
                            <img className="cat-icon skin-main" src={iconSkin} alt="Skin category"/>
                            <img className="cat-icon skin-hover" src={boldSkin} alt="Skin category"/>
                        </button>
                        <span class="caption">Skin</span>
                    </div>

                    <div className="col dis-hover">
                        <button type="button" class="btn icon-btn "><img className="cat-icon" src={iconDisinfectant} alt="Disinfectant category"/></button>
                        <span class="caption">Disinfectant</span>
                    </div>

                    <div className="col tools-hover">
                        <button type="button" class="btn icon-btn "><img className="cat-icon" src={iconMedicalTools} alt="Medical tools category"/></button>
                        <span class="caption">Medical tools</span>
                    </div>

                    <div className="col cat-button">
                        <button type="button" class="btn btn-link">See all</button>
                    </div>
                </div>
            </div>
        </>
    );
}

export default HomeCategories;
